import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { HttpClientModule } from '@angular/common/http';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { RouterModule } from '@angular/router';

import { AppComponent } from './app.component';
// Core Services
import { SensorService } from './core/services/sensor.service';
import { AiService } from './core/services/ai.service';
import { CropService } from './core/services/crop.service';
import { LogisticsService } from './core/services/logistics.service';
// Shared Components
import { HeaderComponent } from './shared/components/header/header.component';
import { SidebarComponent } from './shared/components/sidebar/sidebar.component';
import { SensorCardComponent } from './shared/components/sensor-card/sensor-card.component';
import { AiChatbotComponent } from './shared/components/ai-chatbot/ai-chatbot.component';
// Feature Components
import { DashboardComponent } from './features/dashboard/dashboard.component';
import { LandingComponent } from './landing/landing.component';
import { MyFarmComponent } from './features/my-farm/my-farm.component';
import { CropRoadmapComponent } from './features/crop-roadmap/crop-roadmap.component';
import { AITipsComponent } from './features/ai-tips/ai-tips.component';
import { LogisticsComponent } from './features/logistics/logistics.component';
import { TrainingComponent } from './features/training/training.component';
import { SharedModule } from './shared/shared.module';

@NgModule({
  declarations: [
    AppComponent,
    HeaderComponent,
    SidebarComponent,
    SensorCardComponent,
    AiChatbotComponent,
    DashboardComponent,
    LandingComponent,
    MyFarmComponent,
    CropRoadmapComponent,
    AITipsComponent,
    LogisticsComponent,
    TrainingComponent,
  ],
  imports: [
    BrowserModule,
    HttpClientModule,
    FormsModule,
    ReactiveFormsModule,
    RouterModule.forRoot([
      { path: '', component: DashboardComponent },
      { path: 'training', component: TrainingComponent },
      { path: 'logistics', component: LogisticsComponent },
    ]),
    SharedModule
  ],
  providers: [
    SensorService,
    AiService,
    CropService,
    LogisticsService,
  ],
  bootstrap: [AppComponent],
})
export class AppModule {}
